import React from "react";

export function AboutPage() {
    return (
        <div>
            <h1>
                About us
            </h1>
            <div>
            Welcome to [Your Store Name], where your shopping experience is our top priority! Founded with a passion for quality products and exceptional customer service, we strive to bring you the best in [your product category].
            </div>
        </div>
    )
}
